script: |
  super -f text -I q10350.spq | sort > q10350.out

inputs:
  - name: q10350.spq
    data: |
      SELECT col1 AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE - 88 NOT IN ( + + col1 / + - 75 + + col0, col2 + + CAST ( + - col1 AS INTEGER ) * + + col0 );
  - name: tab2

outputs:
  - name: q10350.out
    data: |
      51
      67
      77
